import { Component } from "react";
const styles={
navbar:{
    display:'flex',
    flexDirection:'row',
    alignItems:'center',
    height:'100px',
    justifyContent:'space-Between',
    position:'relative',
    padding:'0 50px',

    }
}
class Navbar extends Component {
    
    render() {
        return (
          <nav style={styles.navbar}>
              <p>Logo</p>
              <p>Carro</p>
          </nav>
        );
    }
}

export default Navbar;
